oxy_webhelp_navlinks = {"support_tunnels-d23139e1160":{"topics":[{"title":"Timeout setting for support tunnels","shortdesc":"<p class=\"shortdesc\">You can specify the duration for which a Rubrik support tunnel remains open by         setting either an inactivity timeout or an absolute timeout. Inactivity timeout resets with         any activity, and absolute timeout is fixed regardless of activity.<\/p>","href":"saas\/common\/support_tunnel_timeout_setting.html","attributes":{"data-id":"support_tunnel_timeout_setting"},"menu":{"hasChildren":false},"tocID":"support_tunnel_timeout_setting-d23139e1173","topics":[]},{"title":"Opening a support tunnel","shortdesc":"<p class=\"shortdesc\">Open a support tunnel to allow the Rubrik Support engineer to access a Rubrik cluster         and resolve hardware or software issues, or both.<\/p>","href":"saas\/common\/opening_a_support_tunnel.html","attributes":{"data-id":"opening_a_support_tunnel"},"menu":{"hasChildren":false},"tocID":"opening_a_support_tunnel-d23139e1184","topics":[]},{"title":"Closing a support tunnel","shortdesc":"<p class=\"shortdesc\">After the Rubrik Support engineer resolves the issue in a Rubrik cluster by using the         support tunnel you opened, close the support tunnel.<\/p>","href":"saas\/common\/closing_a_support_tunnel.html","attributes":{"data-id":"closing_a_support_tunnel"},"menu":{"hasChildren":false},"tocID":"closing_a_support_tunnel-d23139e1195","topics":[]},{"title":"Information available on the Support Tunnel page","shortdesc":"<p class=\"shortdesc\">Information about the details provided by the Support Tunnel page, including cluster         name, UUID, tunnel status, open nodes, open port, time opened, and time left.<\/p>","href":"saas\/common\/support_tunnel_page_available_info.html","attributes":{"data-id":"support_tunnel_page_available_info"},"menu":{"hasChildren":false},"tocID":"support_tunnel_page_available_info-d23139e1206","topics":[]}]}};